  input: '"TEXT","F3XA","C00033456","We conducted some research in reponse to Mr.
    Ryans recent letter concerning excessive contributions to the Craig for U.S. Senate
    committee.  We discovered that the $2000 contribution (check# 2325) that was reported
    was either lost or misplaced and did not make it through to Mr. Craigs account.  Consequently,
    the disbursement  transaction is void.  Given this finding, the Employee Fund
    for Good Governement is not in violation of laws regarding contribution limits.  The
    actual total of contributions during the primary election cycle amounts to $4000.  Per
    the direction of Mr. Ryan, these transpirings will be reflected in our June 2003
